import { Pagination } from 'antd'
import React, { Component } from 'react'
import './welcome.css'

export default class Welcome extends Component {
    render() {
        return (
            <div>
                <h1>欢迎使用订票系统</h1>
                <Pagination className="welcome" defaultCurrent={1} total={500} simple size="small"/>
            </div>
        )
    }
}
